import React from "react";


const axios = require("axios");
const api = axios.get("https://pokeapi.co/api/v2/pokemon/25/");

const PKMNApp = ()=>{

    api.then(
        function(response){
            console.log(response.data);

        }
    )

    return(
        <div>
            <h1>POKEMON</h1>
        </div>
    )
}

export default PKMNApp;
